import React from 'react';

const Audio = (props) => (
    <div>
        {props.data.previewUrl}
    <audio controls autoPlay>
        <source src={props.data.previewUrl} type="audio/ogg" />
        <source src={props.data.previewUrl} type="audio/mpeg" />
    </audio>
    </div>
);

export default Audio;
